Proposed fix for #4740 - "Node's `require` should implement a new interface `NodeRequire` (rather than direct signature) for specialized extension by other libraries"

usage example extending `require()` with a specialized overload for `'browser-window'`:

```
interface NodeRequireFunction {
    (id: 'browser-window'): { new (options?: GitHubElectron.BrowserWindowOptions) : GitHubElectron.BrowserWindow }
}

// ...

mainWindow = new BrowserWindow({ width: 800, height: 600 });
```

and now Typescript correctly knows the types of the identifiers.

(This is a retry since I screwed up the pull request of the first try, _should_ be the same content as the first one)

Node's `Error` object (denoted by `NodeJS.ErrnoException`) has a member `stack` which was missing from all node versions in DefinitelyTyped.

I noticed this when doing the dreaded log and rethrow:

```
process.on("uncaughtException", function(error : NodeJS.ErrnoException) {
    console.log(error.stack);    // Would show error TS2339: Property 'stack' does not exist on type 'ErrnoException'.
    throw error;
});
```

This seems to be a V8 thing.

So one can write something like this:

``` TypeScript
function browserSyncInit(): browserSync.BrowserSync {
    var browser = browserSync.create();
    browser.init();
    return browser;
}

var browser = browserSyncInit();
```
